import React from 'react';
import './App.css';
import { BrowserRouter as Router, Link, Routes, Route, useNavigate } from 'react-router-dom';
import NaverPage from './NaverPage';
import SsgPage from './SsgPage';
import CoupangPage from './CoupangPage';
import MusinsaPage from './MusinsaPage';
import naver from './버튼 이미지/naver.png';
import ssg from './버튼 이미지/ssg.png';
import coupang from './버튼 이미지/coupang.png';
import musinsa from './버튼 이미지/musinsa.png';

class App extends React.Component {
  render() {
    // useNavigate를 통해 navigate 함수를 가져옵니다.
    const navigate = useNavigate();

    return (
      <Router>
        <div className="center-container">
          {/* onClick 이벤트에서 navigate 함수 사용 */}
          <h1 onClick={() => navigate('/')}>Pingu OCR</h1>

          <input type="file" id="upload" />
          <button id="upload-button">Upload</button>

          <div id="ocr-result"></div>

          <div className="button-container">
            <Link to="/naver_P">
              <button type="button">
                <img src={naver} className="button-img" alt="naver" />
              </button>
            </Link>

            <Link to="/ssg_P">
              <button type="button">
                <img src={ssg} className="button-img" alt="ssg" />
              </button>
            </Link>

            <Link to="/coupang_P">
              <button type="button">
                <img src={coupang} className="button-img" alt="coupang" />
              </button>
            </Link>

            <Link to="/musinsa_P">
              <button type="button">
                <img src={musinsa} className="button-img" alt="musinsa" />
              </button>
            </Link>
          </div>

          <Routes>
            <Route path="/naver_P" element={<NaverPage />} />
            <Route path="/ssg_P" element={<SsgPage />} />
            <Route path="/coupang_P" element={<CoupangPage />} />
            <Route path="/musinsa_P" element={<MusinsaPage />} />
          </Routes>
        </div>
      </Router>
    );
  }
}

export default App;
